I'm glad to hear that you're interested in compiler optimization! Here are a few popular techniques along with simple examples to illustrate how they work:

1. **Constant Folding**: This technique involves evaluating constant expressions at compile time instead of runtime. It helps to reduce the number of instructions and improve performance.

   *Before optimization:*
   ```c
   int add(int a, int b) {
       return a + b;
   }
   int result = add(2, 3);
   ```

   *After constant folding:*
   ```c
   int result = 5;
   ```

2. **Dead Code Elimination (DCE)**: DCE removes code that will never be executed or whose results are not used. This helps to reduce the size of the compiled code and improve performance.

   *Before optimization:*
   ```c
   int foo(int x) {
       int y = x * 2;
       if (x == 0) {
           return 0;
       }
       return y;
   }
   ```

   *After DCE:*
   ```c
   int foo(int x) {
       if (x == 0) {
           return 0;
       }
       return x * 2;
   }
   ```

3. **Common Subexpression Elimination (CSE)**: CSE identifies and eliminates redundant expressions by computing them only once and storing the result. This helps to reduce the number of instructions and improve performance.

   *Before optimization:*
   ```c
   int bar(int a, int b) {
       int x = a + b;
