```
function pack(entities) {
    let buffer = new ArrayBuffer(entities.length * 7);
    let view = new DataView(buffer);
    for (let i = 0; i < entities.length; i++) {
        let entity = entities[i];
        let value = (entity.id << 3) | entity.size;
        view.setUint8(i * 7, value);
    }
    return buffer;
}

function unpack(buffer) {
    let view = new DataView(buffer);
    let entities = [];
    for (let i = 0; i < buffer.byteLength; i += 7) {
        let value = view.getUint8(i);
        let entity = {};
        entity.id = value >> 3;
        entity.size = value & 0x07;
        entities.push(entity);
    }
    return entities;
}
```

